import React from "react";

import { BrowserRouter as Redirect, Route } from "react-router-dom";

const PrivateRoute = function({isAuth,...rest}){
    if(isAuth()){
        console.log(isAuth());
    return <Route
        {...rest}
    />
    }
    else{
        return <Redirect to="/login" />
    }
}

export default PrivateRoute;
